import React from 'react';
import { useRouter } from 'next/router';

export default () => {

    const dispatch = useDispatch();

    const router = useRouter();
    const { postId } = router.query;

    React.useEffect(() => {
        getPost(postId, dispatch)
    }, [postId]);
    return (
        <h2>Hello world</h2>
    )
}
